import {createRouter, createWebHistory} from 'vue-router';
// createRouter는 router 생성 && createWebHistory는 뒤로가기
import HomeIndex from '@/page/HomeIndex.vue'

const router = createRouter({
    history: createWebHistory(),
    // routes의 name은 router.push 할 때 사용
    routes: [ 
        {
            path: '/',
            name: 'Home',
            component: HomeIndex
        }, 
        {
            path: '/company',
            name: 'Company',
            component: HomeIndex
        }, 
        {
            path: '/business',
            name: 'Business',
            component: HomeIndex
        }, 
        {
            path: '/cb',
            name: 'Cb',
            component: HomeIndex
        }, 
        {
            path: '/ad',
            name: 'Ad',
            component: HomeIndex
        }, 
        {
            path: '/cs',
            name: 'Cs',
            component: HomeIndex
        }, 
        {
            path: '/job',
            name: 'Job',
            component: HomeIndex
        }]
    // routes는 링크 주소
});

export default router
